cordova.define("com.jiedaibao.localstorage.HybridLocalStorage", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       localStorageSetObject : function(key, value, type, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'HybridLocalStorage',
            'localStorageSetObject',
            [{
             "key": key,
             "value": value,
             "type": type
             }]
            );
       },
       localStorageGetObject : function(key, type, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'HybridLocalStorage',
            'localStorageGetObject',
            [{
             "key": key,
             "type": type
             }]
            );
       }
    }
  }
);
